  return (
    <div className="App">
      <Router>
        <div>
          <Nav />
          <div>
            <Switch>
              <Route exact path="/" component={Shops} />
              <Route path='/shops/:shopId' component={SingleShop} />
              <Route path='/product/:productId' component={Product} />
            </Switch>
          </div>
        </div>
      </Router>
    </div>
  );
}

export default App;
